import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import ComidaTable from "../tables/ComidaTable"
import ComidaModal from "../modals/ComidaModal"

const comidasInit=[
    {
        "id":1,
        "nombre":"Milanesa",
        "precio":"TUCULO"
    },
    {
        "id":2,
        "nombre":"Empanada",
        "precio":"TUCULO"
    },
    {
        "id":3,
        "nombre":"Tortilla",
        "precio":"TUCULO"
    }


]

function Comida(){
    
       const[comidas, setComidas]=useState(comidasInit)
       const[openModal, setOpenModal]=useState(false)

       function handleOpenModal(props){
           setOpenModal(true);

       }

       function handleComida(event,data){
           event.preventDefault();
           handleOpenModal(true, data);
       }
    
    return  (
        <>
        <ComidaTable 
        data={comidas}
        />
        <ComidaModal
        data={comidas}
        show={openModal}
        />
       
        
        </>
    )
}


export default Comida;
